      "content": "const fs = require('fs');

function createServer({ dataPath }) {
  let todos = [];

  if (fs.existsSync(dataPath)) {
    try {
      const data = fs.readFileSync(dataPath, 'utf8');
      todos = JSON.parse(data).todos || [];
    } catch (err) {
      console.error('Error reading the database file:', err);
    }
  }

  function saveTodos() {
    try {
      fs.writeFileSync(dataPath, JSON.stringify({ todos }, null, 2));
    } catch (err) {
      console.error('Error writing to the database file:', err);
    }
  }

  return require('http').createServer((req, res) => {
    let id = '';
    if (req.url.startsWith('/todos/')) {
      id = req.url.split('/todos/')[1];
    }

    res.setHeader('Content-Type', 'application/json');

    switch (`${req.method}-${id || req.url}`) {
      case 'GET-/health':
        res.writeHead(200);
        res.end(JSON.stringify({ ok: true }));
        break;
      case 'GET-/openapi.json':
        fs.readFile('openapi.json', (err, data) => {
          if (err) {
            res.writeHead(500);
            res.end(JSON.stringify({ error: 'OpenAPI file not found' }));
          } else {
            res.setHeader('Content-Type', 'application/json');
            res.writeHead(200);
            res.end(data);
          }
        });
        break;
      case 'GET-/todos':
        res.writeHead(200);
        res.end(JSON.stringify({ ok: true, todos }));
        break;
      case `GET-${id}`:
        const todo = todos.find(t => t.id === id);
        if (todo) {
          res.writeHead(200);
          res.end(JSON.stringify({ ok: true, todo }));
        } else {
          res.writeHead(404);
          res.end(JSON.stringify({ ok: false, error: 'Todo not found' }));
        }
        break;
      case 'POST-/todos':
        let body = '';
        req.on('data', chunk => {
          body += chunk.toString();
        });
        req.on('end', () => {
          try {
            const newTodo = JSON.parse(body);
            if (!newTodo.title) {
              res.writeHead(400);
              return res.end(JSON.stringify({ ok: false, error: 'Title is required' }));
            }
            newTodo.id = Date.now().toString();
            newTodo.done = false;
            todos.push(newTodo);
            saveTodos();
            res.writeHead(201);
            res.end(JSON.stringify({ ok: true, todo: newTodo }));
          } catch (err) {
            res.writeHead(400);
            res.end(JSON.stringify({ ok: false, error: 'Invalid JSON' }));
          }
        });
        break;
      case `PATCH-${id}`:
        let patchBody = '';
        req.on('data', chunk => {
          patchBody += chunk.toString();
        });
        req.on('end', () => {
          try {
            const patchData = JSON.parse(patchBody);
            const todoIndex = todos.findIndex(t => t.id === id);
            if (todoIndex === -1) {
              res.writeHead(404);
              return res.end(JSON.stringify({ ok: false, error: 'Todo not found' }));
            }
            todos[todoIndex] = { ...todos[todoIndex], ...patchData };
            saveTodos();
            res.writeHead(200);
            res.end(JSON.stringify({ ok: true, todo: todos[todoIndex] }));
          } catch (err) {
            res.writeHead(400);
            res.end(JSON.stringify({ ok: false, error: 'Invalid JSON' }));
          }
        });
        break;
      case `DELETE-${id}`:
        const deleteIndex = todos.findIndex(t => t.id === id);
        if (deleteIndex !== -1) {
          todos.splice(deleteIndex, 1);
          saveTodos();
          res.writeHead(200);
          res.end(JSON.stringify({ ok: true }));
        } else {
          res.writeHead(404);
          res.end(JSON.stringify({ ok: false, error: 'Todo not found' }));
        }
        break;
      default:
        res.writeHead(404);
        res.end(JSON.stringify({ ok: false, error: 'Not Found' }));
    }
  });
}

module.exports = { createServer };
